import React from 'react'
import { FormGroup, Input, Button, Alert } from 'reactstrap'
import styled from 'styled-components'
import img2 from "../Assets/cb.png"

const Form = styled.form`
  max-width: 650px;
  height: 100%;
  display: flex;
  flex-flow: row wrap;
  margin: 60px auto;
  border: 2px solid black;
  padding: 10px;

  h3{
    text-align: center;
  }

  img{
    width: 200px;
    transition: 0.4s;
  }
  img:hover{
    filter: invert(100%);
  }

  #topdesc{
    padding: 20px;
    margin-top: 40px;
  }

  #desc{
    width: 200px;
    text-align: center;
  }

  .form-group{
    width: 270px;
    padding: 50px;
    align-items: center;
    align-content:center;
  }

  FormGroup {
    border:solid;
    margin: 150px;
    width: 200px;
  }
  FormGroup:nth-child(1) {
    margin-bottom:auto;
    margin-right:auto;
    order:0;
  }
  FormGroup:nth-child(2) {
    margin-bottom:auto;
    margin-left:auto;
    order:0;
  }

  FormGroup:nth-child(3) {
    margin-top:auto;
    margin-right:auto;
    order:2;
  }
  FormGroup:nth-child(4) {
    margin-top:auto;
    margin-left:auto;
    order:2;
  }
`


export default function Shop() {

  return (
    <Form style={{ padding: '40px' }} >

      <h3>Shop Premade Bots</h3>

      <p id="topdesc"><center>Choose from various <b>Bots</b> below.</center></p>

      <FormGroup>
          <legend>SupremeDM</legend>
          <img src={img2} alt="SupremeDM"/>
          <br/>
          <a href='https://www.fatfreecartpro.com/i/zwdt?card' style={{"display":"inline-block","background":"rgb(40, 167, 69) url(https://www.e-junkie.com/ej/images/newviewproduct.png) center/110px no-repeat","border":"none","padding":"7px 98px","borderRadius":"3px","textDecoration":"none"}}>&nbsp;</a>
          <p id="desc">
            Hey #Instagrammers Check out #SupremeDM!
            Continue or Start your #instagram messages from your PC, Share Video, Voice Notes & Photo's, Manage users who don't Follow Back & More! A great tool for business!
            SupremeDM Currently only available for #Windows OS
          </p>
      </FormGroup>

      <FormGroup>
          <legend>SupremeGram</legend>
          <img src={img2} alt="SupremeDM"/>
          <br/>
          <a href='https://www.fatfreecartpro.com/i/zwdt?card' style={{"display":"inline-block","background":"rgb(40, 167, 69) url(https://www.e-junkie.com/ej/images/newviewproduct.png) center/110px no-repeat","border":"none","padding":"7px 98px","borderRadius":"3px","textDecoration":"none"}}>&nbsp;</a>
          <p id="desc">
            <b>
              New #Instagram #Bot for your #Desktop 
            Automates #Likes & #Comments so you don't have to. 
            Watch your Likes & #Followers increase while you do nothing!
            v1 & v2 Available for #Download now!
            </b>
          </p>
      </FormGroup>

      <FormGroup>
          <legend>AMFaster v1</legend>
          <img src={img2} alt="SupremeDM"/>
          <br/>
          <a href='https://www.fatfreecartpro.com/i/zwdt?card' style={{"display":"inline-block","background":"rgb(40, 167, 69) url(https://www.e-junkie.com/ej/images/newviewproduct.png) center/110px no-repeat","border":"none","padding":"7px 98px","borderRadius":"3px","textDecoration":"none"}}>&nbsp;</a>
          <p id="desc">
            Hey #Instagrammers Check out #SupremeDM!
            Continue or Start your #instagram messages from your PC, Share Video, Voice Notes & Photo's, Manage users who don't Follow Back & More! A great tool for business!
            SupremeDM Currently only available for #Windows OS
          </p>
      </FormGroup>

    </Form>
  )

}
